#include <stdint.h>
#include <stddef.h>

#include "Gfx.h"
#include "Object.h"
#include "PDFDoc.h"
#include "OutputDev.h"
#include "Dict.h"
#include "/src/xpdf-4.05/xpdf/Gfx.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    if (size < 1) {
        return 0;
    }
    PDFDoc *docA = new PDFDoc();
    OutputDev *outA = new OutputDev();
    Dict *resDict = new Dict();
    PDFRectangle *box = new PDFRectangle();
    PDFRectangle *cropBox = new PDFRectangle();
    Gfx gfx(docA, outA, resDict, box, cropBox);
    Object obj;
    int num = static_cast<int>(data[0]);
    gfx.opSetExtGState(&obj, num);
    return 0;
}

#include <stdint.h>
#include <cstddef>
#include "Object.h"
#include "GfxState.h"
#include "Gfx.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *Data, size_t Size) {
    if (Size < sizeof(int)) {
        return 0;
    }
    Object obj;
    int i = *(const int *)Data; // Ensure that we have enough data for an 'int'
    Gfx::opSetExtGState(&obj, i);
    return 0;
}
